        updateElec(engIndex) {
            const engn1 = SimVar.GetSimVarValue(`TURB ENG N1:${engIndex}`, "percent over 100");
            const voltsbat1 = SimVar.GetSimVarValue(`ELECTRICAL GENALT BUS VOLTAGE:${engIndex}`, "volts");
            const ampsbat = SimVar.GetSimVarValue(`ELECTRICAL GENALT BUS AMPS:${engIndex}`, "amperes");
            const isVoltAndEng = engn1 < 0.05;
            const volts = isVoltAndEng ? engn1 * 100 : voltsbat1;
            if (engIndex === 1) {
                this.dcVolt1.instance.textContent = volts.toFixed(0);
                this.dcAmps1.instance.textContent = ampsbat.toFixed(0);
            }
            else {
                this.dcVolt2.instance.textContent = volts.toFixed(0);
                this.dcAmps2.instance.textContent = ampsbat.toFixed(0);
            }
        }
        lerp(start, end, amt) {
            return (1 - amt) * start + amt * end;
        }
        updateEngTemp() {
            const oat = SimVar.GetSimVarValue("AMBIENT TEMPERATURE", "celsius");
            const eng1On = SimVar.GetSimVarValue("GENERAL ENG COMBUSTION:1", "Bool");
            const eng2On = SimVar.GetSimVarValue("GENERAL ENG COMBUSTION:2", "Bool");
            //ENG FUEL TEMP
            let eng1TempTarget = 0;
            let eng2TempTarget = 0;
            if (eng1On) {
                eng1TempTarget = msfsSdk.MathUtils.clamp(oat + 45, -20, 84);
            }
            else {
                eng1TempTarget = msfsSdk.MathUtils.clamp(oat, -20, 100);
            }
            if (eng2On) {
                eng2TempTarget = msfsSdk.MathUtils.clamp(oat + 45, -20, 84);
            }
            else {
                eng2TempTarget = msfsSdk.MathUtils.clamp(oat, -20, 100);
            }
            this.eng1_Temp = this.lerp(this.eng1_Temp, eng1TempTarget, 0.3);
            this.eng2_Temp = this.lerp(this.eng2_Temp, eng2TempTarget, 0.3);
            this.eng1Temp.instance.textContent = this.eng1_Temp.toFixed(0);
            this.eng2Temp.instance.textContent = this.eng2_Temp.toFixed(0);
            //FUEL TANK TEMP
            this.eng1FuelTankTemp.instance.textContent = SimVar.GetSimVarValue("L:VTX_ENG_1_FUEL_TANK_TEMP", "number").toFixed(0);
            this.eng2FuelTankTemp.instance.textContent = SimVar.GetSimVarValue("L:VTX_ENG_2_FUEL_TANK_TEMP", "number").toFixed(0);
            SimVar.SetSimVarValue("L:VTX_ENG_1_FUEL_ENG_TEMP", "number", this.eng1_Temp);
            SimVar.SetSimVarValue("L:VTX_ENG_2_FUEL_ENG_TEMP", "number", this.eng2_Temp);
        }
