        interpolateRudderLimits(tas) {
            let lowerRudderLimit, upperRudderLimit;
            // Calculate lower rudder limit
            if (tas < 70) {
                lowerRudderLimit = 30;
            }
            else if (tas >= 70 && tas <= 144) {
                lowerRudderLimit = 30 - ((tas - 70) * (30 - 9) / (144 - 70)); // linear interpolation
            }
            else if (tas > 144 && tas <= 375) {
                lowerRudderLimit = 9 - ((tas - 144) * (9 - 4) / (375 - 144)); // linear interpolation
            }
            else {
                lowerRudderLimit = 4;
            }
            // Calculate upper rudder limit
            if (tas < 70) {
                upperRudderLimit = 18;
            }
            else if (tas >= 70 && tas <= 144) {
                upperRudderLimit = 18 - ((tas - 70) * (18 - 4) / (144 - 70)); // linear interpolation
            }
            else if (tas > 144 && tas <= 375) {
                upperRudderLimit = 4 - ((tas - 144) * (4 - 2.4) / (375 - 144)); // linear interpolation
            }
            else {
                upperRudderLimit = 2.4;
            }
            return {
                lowerRudderLimit: lowerRudderLimit,
                upperRudderLimit: upperRudderLimit
            };
        }
        updateControls() {
            const aileron = SimVar.GetSimVarValue("AILERON RIGHT DEFLECTION PCT", "percent");
            const elevator = SimVar.GetSimVarValue("ELEVATOR POSITION", "percent");
            const rudder_small = SimVar.GetSimVarValue("RUDDER DEFLECTION PCT", "percent");
            const rudder_big = SimVar.GetSimVarValue("RUDDER DEFLECTION PCT", "percent");
            const tas = SimVar.GetSimVarValue("AIRSPEED TRUE", "knots");
            const rudder_big_limit = this.interpolateRudderLimits(tas).lowerRudderLimit;
            const rudder_small_limit = this.interpolateRudderLimits(tas).upperRudderLimit;
            const flapsHandleIndex = SimVar.GetSimVarValue("FLAPS HANDLE INDEX", "number");
            const ail1 = -0.53 * (aileron * -1) - 110;
            const ail2 = -0.53 * aileron - 110;
            const elev1 = 0.53 * elevator - 110;
            let rudd2 = -20;
            if (flapsHandleIndex > 0) {
                rudd2 = 2.663 * msfsSdk.MathUtils.clamp(rudder_small, -rudder_small_limit, rudder_small_limit) - 20;
            }
            const rudd1 = 2.663 * msfsSdk.MathUtils.clamp(rudder_big, -rudder_big_limit, rudder_big_limit) - 20;
            this.ailerons1.instance.setAttribute("transform", `translate(-99 ${ail1})`);
            this.ailerons2.instance.setAttribute("transform", `translate(-76 ${ail2})`);
            this.elevator1.instance.setAttribute("transform", `translate(52 ${elev1})`);
            this.elevator2.instance.setAttribute("transform", `translate(73 ${elev1})`);
            this.rudder1.instance.setAttribute("transform", `translate(${rudd1} 57)`);
            this.rudder2.instance.setAttribute("transform", `translate(${rudd2} 29)`);
        }
