    /**
     * The TSS system.
     */
    class TSSSystem extends msfsSdk.BasicAvionicsSystem {
        /**
         * Creates an instance of the TSS System.
         * @param index The index of the system.
         * @param bus The instance of the event bus for the system to use.
         */
        constructor(index, bus) {
            super(index, bus, 'tss_state');
            this.index = index;
            this.bus = bus;
            this.initializationTime = 500;
            /** A timeout after which failed state will occur. */
            this.failureTimer = new msfsSdk.DebounceTimer();
            this.connectToPower('elec_av1_bus');
            this.bus.getSubscriber()
                .on('tdr_state')
                .whenChanged()
                .handle(evt => {
                //Always set to On TODO: Check what this does.
                this.tdrState = msfsSdk.AvionicsSystemState.On;
                this.evaluateState(this.state);
            });
        }
        /**
         * Starts the initialization logic for this system.
         */
        startInitializing() {
            this.failureTimer.clear();
            this.setState(msfsSdk.AvionicsSystemState.Initializing);
            this.initializationTimer.schedule(() => {
                this.setState(msfsSdk.AvionicsSystemState.On);
            }, this.initializationTime);
        }
        /** @inheritdoc */
        onStateChanged(previousState, currentState) {
            this.evaluateState(currentState);
        }
        /**
         * Checks if the System is read to initialize
         * @param currentState The current state of the system.
         */
        evaluateState(currentState) {
            if (currentState !== msfsSdk.AvionicsSystemState.Off) {
                if (this.tdrState !== msfsSdk.AvionicsSystemState.On) {
                    if (currentState !== msfsSdk.AvionicsSystemState.Failed) {
                        this.setState(msfsSdk.AvionicsSystemState.Off);
                        this.initializationTimer.clear();
                        this.failureTimer.schedule(() => {
                            this.setState(msfsSdk.AvionicsSystemState.Failed);
                        }, 1000);
                    }
                }
                else if (currentState !== msfsSdk.AvionicsSystemState.On) {
                    this.startInitializing();
                }
            }
            else {
                this.failureTimer.clear();
                this.initializationTimer.clear();
            }
        }
    }

    /**
     * A class containing some helpers to set up the electricals on instruments.
     */
    class WT21ElectricalSetup {
        /**
         * Initializes the systems used on the instruments.
         * @param systemsArr The instrument's systems array.
         * @param bus The event bus.
         * @param xmlConfig The instrument panel XML config.
         */
        static initializeSystems(systemsArr, bus, xmlConfig) {
            systemsArr.push(new AhrsSystem(1, bus));
            systemsArr.push(new MagnetometerSystem(1, bus));
            systemsArr.push(new ADCSystem(1, bus));
            systemsArr.push(new AOASystem(1, xmlConfig, bus));
            systemsArr.push(new RASystem(1, bus));
            systemsArr.push(new TDRSystem(1, bus));
            systemsArr.push(new TSSSystem(1, bus));
            systemsArr.push(new COMReceiverSystem(1, bus));
        }
        /**
         * Initialize the avionics electrical bus XML logic.
         * @param elecPublisher The electrical publisher.
         * @param instrument The instrument.
         */
        static initializeAvElectrical(elecPublisher, instrument) {
            // HINT: In the future these IDs somehow need to come from the xml like in the Garmins
            const pfdId = 'WT21_PFD';
            const mfdId = 'WT21_MFD_1';
            const pfdBusLogic = this.getElectricalLogicForName(pfdId, instrument);
            const mfdBusLogic = this.getElectricalLogicForName(mfdId, instrument);
            if (pfdBusLogic !== undefined) {
                elecPublisher.setAv1Bus(pfdBusLogic);
            }
            if (mfdBusLogic !== undefined) {
                elecPublisher.setAv2Bus(mfdBusLogic);
            }
        }
        /**
         * Gets the electrical bus XML logic for a given panel name.
         * @param name The name of the panel.
         * @param instrument The instrument.
         * @returns The XML logic element, or undefined if none was found.
         */
        static getElectricalLogicForName(name, instrument) {
            const instrumentConfigs = instrument.xmlConfig.getElementsByTagName('Instrument');
            for (let i = 0; i < instrumentConfigs.length; i++) {
                const el = instrumentConfigs.item(i);
                if (el !== null) {
                    const nameEl = el.getElementsByTagName('Name');
                    if (nameEl.length > 0 && nameEl[0].textContent === name) {
                        const electrics = el.getElementsByTagName('Electric');
                        if (electrics.length > 0) {
                            return new CompositeLogicXMLElement(instrument, electrics[0]);
                        }
                    }
                }
            }
            return undefined;
        }
    }

    class LightBleed {
        constructor(bus, isFmc = false) {
            this.bus = bus;
            const subCustom = this.bus.getSubscriber();
            subCustom.on('screen_light_bleed').handle(() => this.toggleLcdCrt(isFmc));
        }
        toggleLcdCrt(isFmc) {
            const isCrt = SimVar.GetSimVarValue('L:VTX_C750_SCREEN_CRT', 'Bool');
            const elements = document.getElementsByClassName('lightBleed');
            const classToAdd = isFmc ? 'light-bleed-border-fmc' : 'light-bleed-border';
            const classToAdd2 = isCrt ? 'lightBleed-crt' : 'lightBleed-lcd';
            const classToRemove = isCrt ? 'lightBleed-lcd' : 'lightBleed-crt';
            if (isCrt) {
                for (let i = 0; i < elements.length; i++) {
                    elements[i].classList.remove(classToRemove);
                    elements[i].classList.remove(classToAdd);
                    elements[i].classList.add(classToAdd2);
                }
            }
            else {
                for (let i = 0; i < elements.length; i++) {
                    elements[i].classList.remove(classToRemove);
                    elements[i].classList.add(classToAdd);
                    elements[i].classList.add(classToAdd2);
                }
            }
        }
    }

    class ECPidController {
        constructor(kP, kI, kD, maxOut, minOut, maxI, minI) {
            this.previousError = 0;
            this.integral = 0;
            this.kP = 0;
            this.kD = 0;
            this.kI = 0;
            this.maxOut = 0;
            this.minOut = 0;
            this.maxI = 0;
            this.minI = 0;
            this.kP = kP;
            this.kI = kI;
            this.kD = kD;
            this.maxOut = maxOut;
            this.minOut = minOut;
            this.maxI = maxI;
            this.minI = minI;
        }
        getOutput(deltaTime, error, minOut = this.minOut, maxOut = this.maxOut, minI = this.minI, maxI = this.maxI) {
            const p = this.kP * error;
            if (isNaN(this.integral))
                this.integral = 0;
            this.integral += ((error * deltaTime) + ((deltaTime * (error - this.previousError)) / 2)) * this.kI;
            this.integral = msfsSdk.MathUtils.clamp(this.integral, minI, maxI);
            const i = this.integral;
            const d = this.kD * ((error - this.previousError) / deltaTime);
            SimVar.SetSimVarValue("L:CE750_EC_throttleCorrection_RAW", "number", p + i + d);
            SimVar.SetSimVarValue("L:CE750_ECthrottleCorrection_p", "number", p);
            SimVar.SetSimVarValue("L:CE750_EC_throttleCorrection_i", "number", i);
            SimVar.SetSimVarValue("L:CE750_EC_throttleCorrection_d", "number", d);
            const output = msfsSdk.MathUtils.clamp(p + i + d, minOut, maxOut);
            this.previousError = error;
            return output;
        }
        reset() {
            this.previousError = 0;
            this.integral = 0;
        }
    }

